import React from "react";
import { Link, NavLink } from "react-router-dom";
import { Nav } from "react-bootstrap";
import { Button, Avatar } from "@material-ui/core";
import { IoIosLogOut, IoMdRestaurant } from "react-icons/io";

function SignedInLink() {
  return (
    <Nav>
      <NavLink to = '/createproject'>
        <Button variant="light">
          <IoMdRestaurant fontSize="large" />
          &nbsp;New Restaurant
        </Button>
      </NavLink>
      <NavLink href="#Logout">
        <Button variant="light">
          <IoIosLogOut fontSize="large" />
          &nbsp;Log Out
        </Button>
      </NavLink>
      <NavLink href="#As">
        <Button variant="light" disabled>
          Signed in as: &nbsp;
          <a href="/" style={{ color: "GrayText" }}>
            Mark Otto
          </a>
        </Button>
      </NavLink>
      <NavLink href="#Avatar">
        <Avatar alt="Jamie" src="/static/images/avatar/1.jpg" />
      </NavLink>
    </Nav>
  );
}
export default SignedInLink;
